import React from 'react';
import {StyledHeader, StyledSpan, StyledH1} from "./AppHeader.styled";

const AppHeader = () => {
    return (
        <StyledHeader>
            <StyledH1>Todo List</StyledH1>
            <StyledSpan>4 more todo, 1 done</StyledSpan>
        </StyledHeader>
    )
};

export default AppHeader;
